/* * Copyright 2019 Laurent PAGE, Apache Licence 2.0 */package com.agroneo.web.moon.utils;import java.util.Date;public class Moon {	private double _moonAge;	private double _fraction;	private double _moonDist;	private String _moonZodiac;	private Date _lunarNode;	public Moon(double moonAge, double fraction, double moonDist, String moonZodiac, Date lunarNode) {		_moonAge = moonAge;		_fraction = fraction;		_moonDist = moonDist;		_moonZodiac = moonZodiac;		_lunarNode = lunarNode;	}	public String getMoonZodiac() {		return _moonZodiac;	}	public Date dateLunarNode() {		return _lunarNode;	}	public double getMoonDist() {		return _moonDist;	}	public double getMoonAge() {		return _moonAge;	}	public double getFraction() {		return _fraction;	}	@Override	public String toString() {		return this.getClass().getSimpleName() + "[age=" + _moonAge + ",fraction=" + _fraction + ",moonDist=" + _moonDist + "]";	}}